var title_f29_29_30170="Vertical growth melanoma";
var content_f29_29_30170=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F54748%7EONC%2F75460&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F54748%7EONC%2F75460&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 547px\">",
"   <div class=\"ttl\">",
"    Vertical growth phase malignant melanoma",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 527px; height: 566px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Low power photomicrographs of a nodular, vertical growth phase melanoma, characterized by the formation of an expansile nodule of melanoma cells in the dermis. Clinically, this results in a papule or nodule arising against the background of the flat radial growth phase. In the top figure (Panel A), the invasive melanoma has a polypoid growth pattern arising in a superficial spreading melanoma. The surface is ulcerated and the maximum depth of invasion is measured from the base of the ulcer to the deepest melanoma cell. In the bottom figure (Panel B), the invasive melanoma is forming large tumor nodules and has invaded the subcutis (black arrows).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Roy King, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Vertical growth phase melanoma",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 361px; height: 292px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Medium power view of a light photomicrograph showing a vertical growth phase nodular melanoma in which the tumor cells extend deep into the dermis. The lesion is clearly invasive.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Vincent Liu, MD and April Wang Armstrong, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
